import React, { Component, Fragment } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Card from "@material-ui/core/Card";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import ListItemText from "@material-ui/core/ListItemText";
import Avatar from "@material-ui/core/Avatar";

import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import FaceIcon from "@material-ui/icons/Face";
import DoneIcon from "@material-ui/icons/Done";
import { Timeline, Event } from "react-timeline-scribble";

import "./components.css";

export default class About extends Component {
  render() {
    const classes = makeStyles(theme => ({
      root: {
        flexGrow: 1
      },
      skillsroot: {
        display: "flex",
        justifyContent: "center",
        flexWrap: "wrap"
      },
      chip: {
        margin: "10px"
      }
    }));
    function handleDelete() {
      alert("You clicked the delete icon.");
    }

    function handleClick() {
      alert("You clicked the Chip.");
    }
    return (
      <div>
        <div class="about" id="about">
          <div className={classes.root}>
            <Grid container spacing={1}>
              <Grid item xs={4}>
                <Fragment className="padding">
                  <br />
                  <Typography variant="h3">
                    <strong>EDUCATION</strong>
                  </Typography>
                  <br />
                  <Timeline>
                    <Event
                      interval={"2013 – 2017"}
                      title={"Thomas Jefferson HSST"}
                      subtitle={"Student"}
                    >
                      <img
                        src={require("../images/tj.jpg")}
                        className="tjuva"
                      />
                    </Event>
                    <Event
                      interval={"2017 – 2021"}
                      title={"University of Virginia"}
                      subtitle={"SEAS - Computer Science & Statistics"}
                    >
                      <img
                        src={require("../images/uva2.jpg")}
                        className="tjuva"
                      />
                    </Event>
                  </Timeline>
                </Fragment>
              </Grid>
              {/*  */}
              <Grid item xs={4} md={4}>
                <div className={classes.root}>
                  <br />
                  <Typography variant="h3">
                    <strong>COURSES</strong>
                  </Typography>
                  <br />

                  <Grid container spacing={0}>
                    <Grid item xs={6} md={6}>
                      <Typography variant="h4">TJHSST</Typography>

                      <List>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="AP CS" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Artificial Intelligence" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Mobile App Dev" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Computer Vision" />
                        </ListItem>
                      </List>
                    </Grid>
                    {/* UVA Courses */}
                    <Grid item xs={6} md={6}>
                      <Typography variant="h4">UVA</Typography>
                      <List>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS2110 Software Dev. Methods" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS2150 Data/Program Rep." />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS4102 Algorithms" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS4501 Internet Scale App." />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS3240 Adv. Software Dev." />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS3330 Computer Architecture" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS4774 Machine Learning (Curr.)" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/uva2.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="CS4501 Computer Vision (Curr.)" />
                        </ListItem>
                      </List>
                    </Grid>
                  </Grid>
                </div>
              </Grid>
              <Grid item xs={4}>
                <br />
                <Typography variant="h3">
                  <strong>TECHNICAL SKILLS</strong>
                </Typography>
                <br />
                <Typography variant="h5">Languages</Typography>
                <br />

                <div className={classes.root}>
                  <Chip
                    avatar={
                      <img
                        src={require("../images/python.png")}
                        className="avatar2"
                      />
                    }
                    label="Python"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                    className="size"
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/javascript.png")}
                        className="avatar2"
                      />
                    }
                    label="Javascript"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/java.png")}
                        className="avatar2"
                      />
                    }
                    label="Java"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/c++.png")}
                        className="avatar2"
                      />
                    }
                    label="C++"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/r.png")}
                        className="avatar2"
                      />
                    }
                    label="R"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <br />

                  <Typography variant="h5">Frameworks</Typography>
                  <br />

                  <Chip
                    avatar={
                      <img
                        src={require("../images/react.png")}
                        className="avatar2"
                      />
                    }
                    label="React"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/visjs.png")}
                        className="avatar2"
                      />
                    }
                    label="vis.js"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/d3.png")}
                        className="avatar2"
                      />
                    }
                    label="d3.js"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/django.png")}
                        className="avatar2"
                      />
                    }
                    label="Django"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <br />

                  <Typography variant="h5">Tools</Typography>
                  <br />

                  <Chip
                    avatar={
                      <img
                        src={require("../images/aws.jpg")}
                        className="avatar2"
                      />
                    }
                    label="AWS"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/docker.png")}
                        className="avatar2"
                      />
                    }
                    label="Docker"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/unix.png")}
                        className="avatar2"
                      />
                    }
                    label="Unix"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/git.png")}
                        className="avatar2"
                      />
                    }
                    label="GitHub"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/bitbucket.jpg")}
                        className="avatar2"
                      />
                    }
                    label="Bitbucket"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                  <Chip
                    avatar={
                      <img
                        src={require("../images/linux.jpeg")}
                        className="avatar2"
                      />
                    }
                    label="Linux"
                    clickable
                    className={classes.chip}
                    color="basic"
                    onDelete={handleDelete}
                    deleteIcon={<DoneIcon />}
                  />
                </div>
              </Grid>
            </Grid>
          </div>
        </div>
      </div>
    );
  }
}
